1	Entenda o UAIZOUK	Serão 3 dias de imersão presencial para respirar Zouk do início ao fim, com conteúdo selecionado e diversidade de professores e djs que conduzem toda a programação.	Ao longo de todos esses anos de UAIZOUK nós contamos com participantes de todos os níveis das mais diversas cidades do Brasil e do mundo.	O Congresso UAIZOUK é a junção perfeita entre aprendizado para todos os níveis em um ambiente de socialização completo.	https://www.youtube.com/embed/5Q7hGUc3fMY?autoplay=1&mute=1	Veja um breve trailer	Se você é iniciante...	prepare-se para aulas que vão desenvolver sua base, mas também a experiência real de uma balada de Zouk com pessoas que praticam em lugares totalmente diferentes.	Se você é intermediário ou avançado...	prepare-se para aprofundar as técnicas e aprender com professores que rodam o mundo levando o Zouk.	2025-06-16 01:52:23.031711	2025-06-23 18:40:51.102038
