5	Se o participante mencionar que quer outro ritmo (Ex:. Forró)	<p>Se o participante citar outro ritmo além do Zouk, responda com empatia, mas <strong>deixe claro que o UAIZOUK é focado em Zouk</strong>.<br>Pode mencionar que às vezes surgem momentos espontâneos com outros estilos, mas <strong>nunca diga que fazem parte oficial do evento</strong>.</p>	0	t	2025-10-27 20:30:21.942275	2025-10-27 20:30:21.942275
4	Sobre hospedagem	<p>Nós temos um parceiro, que é o Gui (de Franca) que está alugando uma chácara próxima ao evento, o problema é que esgota muito rápido. Lembrando que não é o UAIZOUK organizando, mas o professor Gui. Você pode falar com ele no Whatsapp <a target="_blank" rel="noopener noreferrer nofollow" class="text-neon-cyan hover:text-neon-purple transition-colors cursor-pointer" href="https://wa.me/5516">https://wa.me/5516</a>991782090</p>	0	t	2025-10-07 20:46:51.840392	2025-10-07 23:09:47.954499
