34	Nina e Matheus	Professores Confirmados	SP	https://uaizouk-lp.s3.uaizouk.com.br/artists/1750902496751_ninaematheus.jpg	<p>Nina Darbello e Matheus Franco são dançarinos, professores e coreógrafos brasileiros de Campinas (SP), reconhecidos internacionalmente por seu trabalho com Zouk e Lambada. Parceiros desde 2018, ambos têm formação diversificada em modalidades como Ballet Clássico e Contemporâneo, Jazz e Hip-Hop, além de experiência em teatro musical. Juntos, desenvolvem um trabalho técnico, expressivo e criativo, com apresentações e aulas em eventos e congressos de dança ao redor do mundo.<br></p><p>Nina iniciou sua trajetória na dança aos 5 anos e é conhecida por sua musicalidade, estilo marcante e versatilidade em danças como Lady Style e High Heels. Matheus, que começou na dança aos 20 anos após uma infância esportiva, traz uma abordagem sensível e didática, unindo arte e bem-estar. Ambos são diretores do Barracão da Dança, uma escola referência em Campinas, onde formam novos talentos e promovem a dança como expressão artística e transformação pessoal.</p>	https://youtu.be/SrI2szfwvvs?list=RDSrI2szfwvvs&t=7	1	f	2025-06-26 01:50:35.686117	2025-09-09 01:51:57.309052
39	Jef e Kay	Professores Confirmados	SP	https://uaizouk-lp.s3.uaizouk.com.br/artists/1750969870567_jefekay.jpg	<p>Com trajetórias que se complementam — Jeferson vindo da dança de salão e Kaylane da ginástica rítmica — a dupla transforma técnica e criatividade em pura conexão na pista. Professores da Geração 3D, eles vêm construindo uma parceria forte e cheia de conquistas nos últimos 11 meses.</p><p>Entre os destaques, estão: o título de Rei e Rainha do Zouk de São Paulo 2024, Campeões Nacionais de Zouk Brasileiro, Vice-Campeões Internacionais de Lambada e o 3º lugar no Campeonato Mundial de Zouk Brasileiro. Além disso, Jeferson e Kaylane marcam presença em grandes eventos da cena, como o Mega Lamba Congress (Argentina), International Zouk Congress (IZC), Lambaday Congress e BDF Holiday, levando sua dança contagiante para o mundo.</p><p>Unindo paixão, técnica e inovação, eles seguem inspirando dançarinos e fortalecendo o Zouk e a Lambada.</p>	https://youtu.be/PsRMtm4JX-U	1	f	2025-06-26 20:31:15.86653	2025-09-09 01:51:58.298128
