5	Val e Vanessa	Professores Confirmados	RJ	https://uaizouk-lp.s3.uaizouk.com.br/artists/1750902027865_valevanessa.jpg	<p>Val e Vanessa, nascidos no Rio de Janeiro, Brasil, são conhecidas no mundo do zouk por sua forma divertida e divertida de ensinar. Enfatizando a importância de fundamentos adequados na dança, eles tornam o aprendizado do zouk fácil e alegre para todos. Eles d</p>	https://youtu.be/P8xfdRDq7GY	0	f	2025-06-16 12:21:00.754491	2025-09-09 01:51:53.732896
