1	Luan e Adriana	Professores Confirmados	SP	https://uaizouk-lp.s3.uaizouk.com.br/artists/1750902829595_luaneadriana.jpg	<p>Luan e Adriana Zouk são <strong>um casal de renomados artistas e professores brasileiros de Zouk</strong>. Eles são conhecidos por sua ênfase na conexão e sensação no Zouk, ajudando os alunos a se conectarem consigo mesmos e com seus parceiros de dança em um nível mais profundo. Eles são bicampeões mundiais de Lambada e bicampeões brasileiros de Dança de Salão. Adriana também é a idealizadora do Treinamento Musical - A Jornada do Herói e do Projeto Mulhere-se, além de diretora da Imersão para Mulheres DHARMA.<br><br><em>senha: queijominas</em></p>	https://www.youtube.com/watch?v=5NVhYwHKpDU	1	f	2025-06-16 01:52:23.031711	2025-09-09 01:51:56.461212
