23	1	t	"{\\"products\\":[{\\"name\\":\\"Camiseta\\",\\"price\\":0,\\"options\\":[\\"Babylook P\\",\\"Babylook M\\",\\"Babylook G\\",\\"Babylook GG\\",\\"Babylook XGG\\",\\"Unissex P\\",\\"Unissex M\\",\\"Unissex G\\",\\"Unissex GG\\",\\"Unissex XGG\\"],\\"description\\":\\"Camiseta oficial do evento (ainda sem a arte divulgada)\\"},{\\"name\\":\\"Combo Alimentação\\",\\"price\\":210,\\"options\\":[\\"Sim\\",\\"Não\\"],\\"description\\":\\"Inclui almoço e jantar dos dias 5, 6 e 7.\\",\\"availableUntil\\":\\"2026-08-06T01:07:00.000Z\\"}],\\"ticketTypes\\":[{\\"name\\":\\"Individual\\",\\"price\\":600,\\"description\\":\\"Inclui acesso completo a experiência imersiva do UAIZOUK, válido para uma pessoa conforme dados aqui descritos.\\",\\"requiresPartner\\":false},{\\"name\\":\\"Dupla\\",\\"price\\":449,\\"description\\":\\"Inclui acesso completo a experiência imersiva do UAIZOUK, válido para uma pessoa conforme dados aqui descritos. O valor se trata de uma oferta para aquisição em dupla, mas podem se inscrever separadamente aqui (cada um paga o seu).\\",\\"requiresPartner\\":true}],\\"foreignerOption\\":{\\"enabled\\":false},\\"paymentSettings\\":{\\"allowPix\\":true,\\"dueDateLimit\\":\\"2026-08-20\\",\\"allowCreditCard\\":true,\\"pixDiscountPercentage\\":5,\\"creditCardFeePercentage\\":5},\\"termsAndConditions\\":\\"**Edição de 2026 - Termos e Condições**\\\\n\\\\n**Da Inscrição**\\\\n\\\\n1. O atraso por período superior a 5 dias ou o não pagamento de qualquer parcela concede à organização o direito de cancelar o acordo sem direito a reembolso e sem aviso prévio.\\\\n\\\\n2. Este formulário representa uma confirmação de compra. A partir do primeiro pagamento, não será concedido reembolso em caso de no-show (não comparecimento) ou desistência, exceto nos casos definidos pelo Art. 49 da Lei 8.078/09 do Código de Defesa do Consumidor, que assegura um prazo legal de 7 (sete) dias após a compra realizada por telefone ou por site para o estorno integral.\\\\n\\\\n3. Ao assinar este contrato, você concorda explicitamente que a Organização do Congresso uaizouk não realizará reembolso em casos de desistência e/ou não comparecimento (no-show), exceto conforme definido no item 2.\\\\n\\\\n4. O atraso no pagamento de qualquer parcela resultará automaticamente em juros de 10% ao mês, pro rata die, além de multa de 20% sobre cada parcela e honorários advocatícios de 20%, calculados sobre o valor inadimplido, de acordo com a legislação vigente.\\\\n\\\\n5. Ao assinar este termo, você declara ser legalmente responsável por todas as informações aqui fornecidas e reconhece estar ciente do Art. 171 do Código Penal: Obter, para si ou para outrem, vantagem ilícita, em prejuízo alheio, induzindo ou mantendo alguém em erro, mediante artifício, ardil ou qualquer outro meio fraudulento.\\\\n\\\\n6. Você está ciente de que a inscrição é pessoal e que é possível transferir a titularidade apenas até o dia 01 de Julho de 2026, sem encargos. Após essa data, será permitida a transferência mediante o pagamento de uma taxa de R$ 100,00 (cem reais) até 01 de Agosto de 2026. Após essa data, as transferências de titularidade não serão permitidas.\\\\n\\\\n6.1 Qualquer transferência deve ser comunicada por e-mail para **credenciamento@uaizouk.com.br**, contendo uma declaração de transferência com os dados do novo titular, conforme o exemplo de dados abaixo:\\\\n\\\\n\\\\\\"Eu, ______________, (nacionalidade), (profissão), (estado civil), portador(a) do RG nº ___________ e CPF nº ____________, residente e domiciliado(a) na Rua ______________, nº _____, Bairro _________, Cidade de ______________, Estado de _____________, CEP _________, transfiro minha vaga do Congresso uaizouk Edição 2026, em acomodação (   ) quarto  (    ) camping para Pumba da Silva ______________, (nacionalidade), (profissão), (estado civil), portador(a) do RG nº ___________ e CPF nº  ____________, residente e domiciliado(a) na Rua ______________, nº _____, Bairro _________, Cidade de ______________, Estado de _____________, CEP _________, e-mail ________________, celular _______________, (    ) vegetariano(a).\\\\\\"\\\\n\\\\n6.2 Se a inscrição tiver débitos em aberto, o novo titular se tornará um devedor solidário, sem benefício de ordem, com o antigo titular.\\\\n\\\\n6.3 Os ingressos recebidos por cortesia não podem ser transferidos. O descumprimento resultará em multa no valor de R$ 1500 (mil e quinhentos reais), além de ressarcimento pelos danos causados à organização, se houver.\\\\n\\\\n6.4 A organização reserva-se o direito de rejeitar pedidos de transferência que considerar, a seu critério exclusivo, terem sido feitos com informações inválidas, incluindo valores adulterados, promoções fraudulentas, má-fé ou outros motivos.\\\\n\\\\n7. Se não houver pagamento de qualquer parcela ou houver atraso superior a 5 dias, a inscrição será automaticamente cancelada, sem aviso prévio e sem direito a reembolso.\\\\n\\\\n8. Ao concordar com os termos, você autoriza a Organização do Congresso uaizouk a emitir boletos de cobrança para pagamentos relacionados às informações fornecidas aqui. Se não receber os boletos por extravio dos Correios ou por qualquer outro motivo, você deverá entrar em contato com a organização. A ausência de ação resultará na sua exclusiva responsabilidade pelas consequências da mora.\\\\n\\\\n9. A organização reserva-se o direito de rejeitar pedidos de inscrição que considerar, a seu critério exclusivo, terem sido feitos com informações inválidas, incluindo valores adulterados, promoções fraudulentas, má-fé ou outros motivos.\\\\n\\\\n10. A organização não efetuará transferências após o prazo estabelecido no item 6.\\\\n\\\\n**Sobre a Participação no Evento**\\\\n\\\\n11. Informamos e alertamos aos participantes que as danças e atividades recreativas realizadas durante o evento podem resultar em lesões, torções, fraturas, rupturas etc. Portanto, ciente e livremente, assumo todos os riscos inerentes a essa atividade, conhecidos ou desconhecidos, e assumo a responsabilidade total pela minha participação, incluindo o respeito às regras e orientações dos instrutores, organização e representantes do evento.\\\\n\\\\n12. Declaro desde já que isento a Organização do Congresso uaizouk de qualquer responsabilidade em caso de acidente, seja de ordem civil ou criminal, e afirmo que obedecerei e acatarei todas as regras de participação estabelecidas no local. Caso ocorra qualquer alteração comportamental significativa durante minha presença, concordo em ser impedido de participar das atividades (sem direito a reembolso pelo ingresso) e, caso minha conduta represente risco à minha integridade física ou de terceiros, assumirei total responsabilidade pelos danos resultantes, sejam pessoais, materiais ou morais.\\\\n\\\\n13. O adquirente reconhece que, ao se inscrever e assinar este termo, terá acesso a informações ou documentos, bem como materiais confidenciais, (\\\\\\"Informações Confidenciais\\\\\\"), incluindo, entre outros, informações técnicas, informações relacionadas ao respectivo ramo de atuação, conhecimento técnico (\\\\\\"Know-How\\\\\\") operacional, estratégias de mercado, informações de serviços, informações de distribuidores, fornecedores e novos serviços.\\\\n\\\\n13.1 As informações devem ser mantidas confidenciais em todas as circunstâncias e não podem ser divulgadas a terceiros não autorizados, sem a expressa autorização por escrito da Organização do Congresso uaizouk.\\\\n\\\\n13.2 As informações a serem mantidas confidenciais são todas aquelas divulgadas e/ou compartilhadas durante o Congresso e que, por sua natureza, não devem ser conhecidas por terceiros, como:\\\\n   I. Listas e documentos contendo informações confidenciais, incluindo aquelas relacionadas aos temas tratados no Congresso;\\\\n   II. Estratégias econômicas, financeiras, de investimento, de captação de recursos, de marketing, informações sobre clientes e serviços, armazenadas em qualquer formato, inclusive digital;\\\\n   III. Métodos e ferramentas para desenvolvimento de produtos e serviços, criados durante o Congresso;\\\\n   IV. Informações de natureza operacional, financeira, administrativa, contábil e jurídica;\\\\n   V. Outros documentos e informações que possam ser conhecidos durante o evento.\\\\n\\\\n14. O adquirente reconhece que os exemplos dados no item 13.2 são apenas ilustrativos, e que outras situações de confidencialidade, existentes ou futuras, devem ser mantidas em sigilo. Em caso de dúvida sobre a natureza confidencial de determinada informação, o adquirente deverá mantê-la em sigilo até receber autorização expressa da Organização do Congresso uaizouk para agir de forma diferente.\\\\n\\\\n14.1 Em nenhuma circunstância, a falta de manifestação expressa da Organização do Congresso uaizouk pode ser interpretada como liberação, e todos os compromissos assumidos permanecem válidos.\\\\n\\\\n14.2 O não cumprimento de quaisquer cláusulas deste termo resultará em responsabilidade civil e criminal daqueles comprovadamente envolvidos na violação ou descumprimento, incluindo indevida divulgação em redes sociais, ambiente virtual, aplicativos de mensagens, entre outros, o que será considerado evidência de descumprimento do compromisso de sigilo.\\\\n\\\\n15. Declaro ser maior de 18 anos, estar em pleno gozo de todas as minhas faculdades mentais e cognitivas, e afirmo ser totalmente capaz de realizar todos os atos da vida civil, não possuindo restrições para participar do evento aqui descrito. Concordo livremente em aderir a este termo e comprometo-me a respeitar todas as cláusulas e regras descritas.\\\\n\\\\n16. É expressamente proibida a entrada no evento com alimentos, pedidos de delivery, incluindo serviços como iFood, e bebidas alcoólicas. Tal medida não se caracteriza como venda casada, pois visa exclusivamente resguardar a segurança e o bem-estar de todos os participantes, garantindo a conformidade com as normas de segurança estabelecidas para o evento, que ocorre em local particular.\\\\n\\\\n17. Fica estabelecido que o foro da Comarca de Uberlândia - MG será responsável por dirimir possíveis dúvidas resultantes da celebração deste termo, com renúncia expressa a qualquer outro, mesmo que mais privilegiado.\\\\n\\\\n18. **Direitos de Imagem**\\\\n\\\\n   Ao participar do evento, o participante concorda expressamente que fotos e vídeos capturados durante as atividades poderão ser utilizados pela Organização do Congresso uaizouk para divulgação em suas redes sociais, materiais promocionais e demais meios de comunicação. O participante autoriza a utilização de sua imagem sem a necessidade de qualquer remuneração ou autorização adicional.\\\\n\\\\nE ao concordar com os termos, assino este documento por minha vontade e convicção livre.\\"}"	2025-10-15 15:31:10.885657	2025-10-15 15:31:10.885657
