COPY public.faqs (id, question, answer, display_order, is_active, created_at, updated_at) FROM stdin;
1	Preciso ter um par para participar do UAIZOUK?	<p>Não! Você pode se inscrever individualmente e será muito bem recebido(a). O UAIZOUK é conhecido pelo ambiente acolhedor e pela facilidade de integração entre os participantes.</p>	1	t	2025-09-09 02:09:36.19209	2025-09-09 02:09:36.19209
2	Sou iniciante, posso participar?	<p>Claro! O UAIZOUK é para <strong>participantes de todos os níveis</strong>. Temos aulas específicas para iniciantes e você terá a oportunidade de aprender com professores renomados em um ambiente totalmente inclusivo.</p>	2	t	2025-09-09 02:09:36.19209	2025-09-09 02:09:36.19209
3	Onde fica o local do evento?	<p>O UAIZOUK acontece no <strong>Recanto da Lua</strong>, localizado no bairro Chácaras Panorama em Uberlândia-MG. É uma chácara dentro da cidade, oferecendo um ambiente único para o evento.</p>	3	t	2025-09-09 02:09:36.19209	2025-09-09 02:09:36.19209
4	Como faço para me inscrever?	<p>As inscrições podem ser feitas através do nosso site oficial. Clique no botão "QUERO PARTICIPAR" em qualquer seção da página para ser direcionado ao formulário de inscrição.</p>	4	t	2025-09-09 02:09:36.19209	2025-09-09 02:09:36.19209
6	Qual é o valor da inscrição?	<p>Os valores são atualizados constantemente e podem variar dependendo da época da inscrição. <strong>Há descontos especiais para inscrições em dupla!</strong></p><p>Para conferir os valores mais atuais, clique em "QUERO PARTICIPAR" e acesse a página oficial de inscrições.</p>	6	t	2025-09-09 02:12:07.093285	2025-09-09 02:12:07.093285
9	Como chegar em Uberlândia?	<p><strong>Principais formas de chegar:</strong></p><ul><li><strong>São Paulo:</strong> 50 minutos de voo ou 8 horas de ônibus</li><li><strong>Belo Horizonte:</strong> 50 minutos de voo ou 10 horas de ônibus</li><li><strong>Rio de Janeiro:</strong> 60 minutos de voo</li></ul><p>A cidade possui excelente infraestrutura e é classificada entre as que mais sediam eventos internacionais no Brasil.</p>	9	t	2025-09-09 02:12:07.509781	2025-09-09 02:12:07.509781
10	Preciso ter experiência em Zouk para participar?	<p><strong>Não é necessário!</strong> O UAIZOUK é conhecido por receber <strong>participantes de todos os níveis</strong>, desde iniciantes até avançados.</p><p>Temos aulas específicas para cada nível e o ambiente é totalmente acolhedor para quem está começando.</p>	10	t	2025-09-09 02:12:07.654778	2025-09-09 02:12:07.654778
12	Quando acontece o UAIZOUK?	<p>O UAIZOUK 2026 está marcado para <strong>4–7 de Setembro de 2026</strong> em Uberlândia, MG.</p><p>O evento sempre acontece em <strong>setembro</strong> e é uma tradição anual que reúne zoukeiros de todo o Brasil e do mundo!</p>	12	t	2025-09-09 02:12:07.931228	2025-09-09 02:12:07.931228
14	Posso cancelar minha inscrição?	<p>As <strong>políticas de cancelamento</strong> podem variar de acordo com a época da solicitação e outros fatores.</p><p>Para informações detalhadas sobre cancelamentos e reembolsos, consulte os termos na página de inscrições ou entre em contato através do WhatsApp oficial do evento.</p>	14	f	2025-09-09 02:12:08.231156	2025-09-09 02:12:53.218847
15	Há desconto para grupos?	<p><strong>Sim!</strong> Existe desconto especial quando você se inscreve em <strong>dupla</strong> com um(a) amigo(a).</p><p>Ambos precisam se inscrever normalmente, mas ambos recebem desconto no valor final.</p><p>Consulte os valores atualizados na página de inscrições!</p>	15	f	2025-09-09 02:12:08.369681	2025-09-09 02:12:54.691671
11	O que está incluído na inscrição?	<p><strong>A inscrição geralmente inclui:</strong></p><ul><li>Acesso a todas as aulas e workshops</li><li>Participação nas baladas oficiais</li><li>Alimentação durante o evento</li><li>Material do congresso</li><li>Acesso às instalações do Recanto da Lua</li></ul><p><em>Consulte os detalhes específicos na página de inscrições para a edição atual.</em></p>	11	f	2025-09-09 02:12:07.793126	2025-09-09 02:13:08.675456
7	O evento inclui hospedagem e alimentação?	<p>A <strong>hospedagem não está inclusa</strong> na inscrição. Uberlândia oferece diversas opções de hotéis e pousadas próximas ao evento.</p><p>A alimentação é adquirida no local com os parceiros que fornecem alimentação a preços compatíveis.</p>	7	f	2025-09-09 02:12:07.233719	2025-09-09 02:15:00.372337
16	Posso comprar ingressos para duas pessoas de uma vez só?	<p>Não, cada um precisa fazer sua inscrição mesmo se for na inscrição dupla (cada um preenche o seu). <br>Cada participante precisa ter seu próprio cadastro, aceitar os termos e preencher os dados pessoais.</p>	5	t	2025-10-27 20:28:18.34742	2025-10-27 20:28:18.34742
